import React, { VFC } from "react"
import { Typography } from "@mui/material"

const Header: VFC = () => {
  const styles: { [key: string]: React.CSSProperties } = {
    container: {
      boxShadow: "0px 13px 10px 5px rgba(0, 0, 0, 0.12)",
      height: 50,
      display: "flex",
      alignItems: "center",
      padding: "0px 16px",
      position: "sticky",
      top: 0,
      backgroundColor: "#ffffffdf",
    },
    textContainer: {
      padding: "16px",
    },
  }

  return (
    <nav style={styles.container}>
      <Typography>Wecken</Typography>
    </nav>
  )
}

export default Header
